    false,nt"url": null,nt"notes": "This annual narrative report for Kirwin
    National Wildlife Refuge summarizes refuge activities during the 1996 calendar year.
     The report begins with a summary of the years highlights and climatic conditions.
    The report includes a planning section which discusses master plans, management
    plans, public participation, research and investigations, and other.  Refuge administration
    is outlined; information about personnel, youth programs, other manpower programs,
    volunteer programs, funding, safety, and other is given.  Habitat management is
    also covered.  Subjects include general, wetlands, croplands, grasslands, grazing,
    fire management, and Partners for Wildlife.  The wildlife section of the report
    discusses wildlife diversity, endangered andor threatened species, waterfowl, marsh
    and water birds, shorebirds, gulls, terns and allied species, raptors, other migratory
    birds, other resident wildlife, and fisheries resources, and scientific collections.
     The public uses of the refuge described in this report include general, outdoor
    classrooms students, interpretive exhibitsdemonstrations, other interpretive programs,
    hunting, fishing, wildlife observation, camping, law enforcement and cooperating
    associations.  The equipment and facilities section of the report provides information
    about new construction, rehabilitation, major maintenance, communications systems,
    computer systems and energy conservation.  Items of interest are provided at the
    end.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
